let returnIcon;

if (context.item.data?.["status"] == "Portal") {
  returnIcon = "fas fa-user-tie";
} else if (context.item.data?.["status"] == "inbound"
|| context.item.data?.["status"] == "outbound" ) {
   returnIcon = "fas fa-sitemap"
}else if (context.item.data?.["status"] == "holiday"){
  returnIcon = "fas fa-cogs"
}else if (context.item.data?.["status"] == "custom"){
  returnIcon = "fas fa-users-cog"
}
return returnIcon

